    function _ownerAndNonceOf(uint256 tokenID) internal view virtual returns (address owner, uint256 nonce);

    function _approveFor(
        address owner,
        uint256 nonce,
        address operator,
        uint256 tokenID
    ) internal virtual;

    function _setApprovalForAll(
